import React, { useEffect, useMemo, useState } from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import { FaPlus, FaUserFriends } from 'react-icons/fa';
import API from '../services/api';
import { DEFAULT_PROPERTY_IMAGE } from '../constants/propertyMedia';

const useQuery = () => new URLSearchParams(useLocation().search);

export default function Messages() {
  const query = useQuery();
  const navigate = useNavigate();
  const [conversations, setConversations] = useState([]);
  const [activeId, setActiveId] = useState(null);
  const [messages, setMessages] = useState([]);
  const [loading, setLoading] = useState(true);
  const [sending, setSending] = useState(false);
  const [error, setError] = useState('');
  const [composer, setComposer] = useState('');

  const loadConversations = async () => {
    try {
      const res = await API.get('/conversations');
      setConversations(res.data || []);
      return res.data || [];
    } catch (err) {
      console.error(err);
      setError(err.response?.data?.message || 'Unable to load conversations.');
      return [];
    }
  };

  const loadMessages = async (conversationId) => {
    if (!conversationId) return;
    try {
      const res = await API.get(`/conversations/${conversationId}/messages`);
      setMessages(res.data || []);
    } catch (err) {
      console.error(err);
      setError(err.response?.data?.message || 'Unable to load messages.');
    }
  };

  useEffect(() => {
    const bootstrap = async () => {
      setLoading(true);
      const recipient = query.get('recipient');
      const property = query.get('property');
      if (recipient) {
        try {
          const res = await API.post('/conversations', {
            recipientId: Number(recipient),
            propertyId: property ? Number(property) : null
          });
          const convoId = res.data?.id;
          const convos = await loadConversations();
          if (convoId) {
            setActiveId(convoId);
            await loadMessages(convoId);
          } else if (convos.length) {
            setActiveId(convos[0].id);
            await loadMessages(convos[0].id);
          }
        } catch (err) {
          console.error(err);
          setError(err.response?.data?.message || 'Unable to start conversation.');
        } finally {
          navigate('/messages', { replace: true });
          setLoading(false);
        }
        return;
      }

      const convos = await loadConversations();
      if (convos.length) {
        setActiveId(convos[0].id);
        await loadMessages(convos[0].id);
      }
      setLoading(false);
    };

    bootstrap();
  }, []);

  const activeConversation = useMemo(
    () => conversations.find((conversation) => conversation.id === activeId),
    [conversations, activeId]
  );

  const otherMembers = useMemo(() => {
    if (!activeConversation) return [];
    return activeConversation.members || [];
  }, [activeConversation]);

  const handleSend = async () => {
    if (!composer.trim() || !activeId) return;
    setSending(true);
    try {
      await API.post(`/conversations/${activeId}/messages`, { body: composer.trim() });
      setComposer('');
      await loadMessages(activeId);
      await loadConversations();
    } catch (err) {
      console.error(err);
      setError(err.response?.data?.message || 'Unable to send message.');
    } finally {
      setSending(false);
    }
  };

  const handleCreateChat = async (isGroup) => {
    const placeholder = isGroup ? 'Enter user IDs separated by commas' : 'Enter the user ID';
    const input = window.prompt(placeholder);
    if (!input) return;
    const ids = input
      .split(',')
      .map((value) => value.trim())
      .filter(Boolean)
      .map((value) => Number(value))
      .filter((value) => Number.isFinite(value));
    if (!ids.length) return;

    try {
      const res = await API.post('/conversations', {
        memberIds: isGroup ? ids : undefined,
        recipientId: !isGroup ? ids[0] : undefined,
        name: isGroup ? 'New group' : null
      });
      const convoId = res.data?.id;
      const convos = await loadConversations();
      if (convoId) {
        setActiveId(convoId);
        await loadMessages(convoId);
      } else if (convos.length) {
        setActiveId(convos[0].id);
        await loadMessages(convos[0].id);
      }
    } catch (err) {
      console.error(err);
      setError(err.response?.data?.message || 'Unable to create conversation.');
    }
  };

  return (
    <div className="messages-page">
      <div className="messages-sidebar">
        <div className="messages-header">
          <h1 className="h5 mb-0">Messages</h1>
          <div className="messages-actions">
            <button type="button" className="btn btn-outline-primary btn-sm" onClick={() => handleCreateChat(false)}>
              <FaPlus className="me-1" />
              New chat
            </button>
            <button type="button" className="btn btn-outline-secondary btn-sm" onClick={() => handleCreateChat(true)}>
              <FaUserFriends className="me-1" />
              New group
            </button>
          </div>
        </div>
        {loading ? (
          <div className="text-muted">Loading conversations...</div>
        ) : conversations.length ? (
          <div className="messages-list">
            {conversations.map((conversation) => (
              <button
                key={conversation.id}
                type="button"
                className={`messages-item ${conversation.id === activeId ? 'is-active' : ''}`}
                onClick={async () => {
                  setActiveId(conversation.id);
                  await loadMessages(conversation.id);
                }}
              >
                <div className="messages-item-title">
                  {conversation.name || conversation.members.map((member) => member.name).join(', ')}
                </div>
                <div className="messages-item-preview">{conversation.last_message || 'Start the conversation'}</div>
              </button>
            ))}
          </div>
        ) : (
          <div className="text-muted">No conversations yet.</div>
        )}
      </div>
      <div className="messages-thread">
        {error && <div className="alert alert-warning">{error}</div>}
        {activeConversation ? (
          <>
            <div className="messages-thread-header">
              <div>
                <h2 className="h5 mb-1">
                  {activeConversation.name || otherMembers.map((member) => member.name).join(', ')}
                </h2>
                <div className="messages-member-row">
                  {otherMembers.map((member) => (
                    <div key={member.id} className="messages-member">
                      <img src={member.profile_image_url || DEFAULT_PROPERTY_IMAGE} alt={member.name} />
                      <span>{member.name}</span>
                    </div>
                  ))}
                </div>
              </div>
            </div>
            <div className="messages-thread-body">
              {messages.length ? (
                messages.map((message) => (
                  <div key={message.id} className="message-bubble">
                    <div className="message-meta">{message.sender_name}</div>
                    <p>{message.body}</p>
                  </div>
                ))
              ) : (
                <div className="text-muted">No messages yet. Say hello.</div>
              )}
            </div>
            <div className="messages-thread-footer">
              <input
                type="text"
                className="form-control"
                placeholder="Write a message"
                value={composer}
                onChange={(event) => setComposer(event.target.value)}
                onKeyDown={(event) => {
                  if (event.key === 'Enter') {
                    handleSend();
                  }
                }}
              />
              <button type="button" className="btn btn-primary" onClick={handleSend} disabled={sending}>
                Send
              </button>
            </div>
          </>
        ) : (
          <div className="messages-empty text-muted">Select a conversation to start chatting.</div>
        )}
      </div>
    </div>
  );
}
